import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the mobile menu
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');
    await page.waitForSelector('.mobile-menu', { timeout: 5000 });

    // Take screenshot of the mobile menu
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_opened.png'));

    // Interact with a category link
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');

    // Take screenshot after clicking category
    await page.waitForSelector('.products-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category.png'));

    // Close the mobile menu
    await page.click('.close-mobile-menu');
    await page.waitForSelector('.mobile-menu', { state: 'hidden', timeout: 5000 });

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_mobile_menu_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_mobile_menu_closed.png'));

    return {
      success: true,
      action: "Tested mobile menu navigation and category selection",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
